import React from 'react';

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isEditProfilePopupOpen: false,
            isAddPlacePopupOpen: false,
            isEditAvatarPopupOpen: false,

        };
        // this.onEditAvatar = `${props.onEditAvatar}`,
        // this.onAddPlace = `${props.onAddPlace}`,
        // this.onEditProfile = `${props.onEditProfile}`
      }
      render(){
    return (
        <main className="main page__main">
            <section className="profile main__profile">
                <div onClick={this.props.onEditAvatar} className="profile__wrapper">
                    <img
                        className="profile__avatar"
                        src="<%=require('../images/Jacques-Yves_Cousteau.png')%>"
                        alt="Аватар профиля."
                    />
                </div>
                <div className="profile__info">
                    <h1 className="profile__name">Жак-Ив Кусто</h1>
                    <button onClick={this.props.onEditProfile} className="profile__edit-button" type="button" />
                    <h2 className="profile__description">Исследователь океана</h2>
                </div>
                <button onClick={this.props.onAddPlace} className="profile__add-button" type="button" />
            </section>
            <section className="main__gallery">
                <ul className="gallery"></ul>
            </section>
        </main>
    )

      }
}

export default Main
